pub enum ClientMessage {
    ConnectionInit {
            payload: Option<serde_json::Value>,
        },
    Start {
            id: String,
            payload: Request,
        },
    Stop {
            id: String,
        },
    ConnectionTerminate,
    Ping {
            payload: Option<serde_json::Value>,
        },
    Pong {
            payload: Option<serde_json::Value>,
        },
}

pub enum Deprecation {
    NoDeprecated,
    Deprecated {
            reason: Option<&'static str>,
        },
}
